import Collaborator from '../Collaborator'
import './Team.css'

const Team = (props) => {
    return (
        <section className='team' style={{ backgroundColor: props.secondColor }}>
            <h3 style={{borderColor: props.firstColor }}>{props.name}</h3>
            {props.collaborators.map( collaborator => <Collaborator name={collaborator.name} cargo={collaborator.cargo} /> )}
        </section>
    )
}

export default Team
